// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract CreateNFT is ERC721Enumerable, Ownable {
    string public baseURI;
    uint256 public nftCounter;
    uint256[] public costsWL;
    uint256 public maxSupply = 10000;
    uint256 public maxMintAmount;
    uint256 public publicMintPrice;
    uint256[] wlPlaces;
    bool public paused = false;
    bool public revealed = false;
    bool public publicMintPossible = false;
    string public notRevealedUri;
    string public contractUri;
    mapping(address => bool) public whitelisted;
    mapping(address => uint256) public minted;

    constructor (string memory _initNotRevealedUri, string memory _name,
        string memory _symbol,
        string memory _initBaseURI, string memory _initContractURI, uint256[] memory _initWlCosts, uint256[] memory _initWlPlaces, uint256 _initMaxMintAmount, uint256 _initPublicMintPrice) public ERC721 (_name, _symbol){
        setBaseURI(_initBaseURI);
        setNotRevealedURI(_initNotRevealedUri);
        setPublicMintPrice(_initPublicMintPrice);
        setContractURI(_initContractURI);
        nftCounter = 1;
        setWLCosts(_initWlCosts);
        setWLPlaces(_initWlPlaces);
        setMaxMintAmount(_initMaxMintAmount);
        //owner = msg.sender;
    }



    function contractURI() public view returns (string memory) {
        return contractUri;
    }

    function setWLCosts(uint256[] memory _costsWL) public onlyOwner {
        costsWL = _costsWL;

    }

    function setWLPlaces(uint256[] memory _placesWL) public onlyOwner {
        wlPlaces = _placesWL;

    }

    function setPublicMintPrice(uint256 _publicMintPrice) public onlyOwner {

        publicMintPrice = _publicMintPrice;
    }

    function setMaxMintAmount(uint256 _maxMintAmount) public onlyOwner {
        maxMintAmount = _maxMintAmount;

    }

    // internal
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    // adds user address to whitelist
    function addUser(address _addressToWhitelist) public onlyOwner {
        whitelisted[_addressToWhitelist] = true;
    }

    //checks if user is on whitelist
    function verifyUser(address _whitelistedAddress) public view returns (bool) {
        bool userIsWhitelisted = whitelisted[_whitelistedAddress];
        return userIsWhitelisted;
    }

    modifier isWhitelisted(address _address) {
        require(whitelisted[_address], "You need to be whitelisted");
        _;
    }

    //reveal the collection
    function setRevealed() public onlyOwner {
        revealed = true;
    }

    //set the mint public
    function setPublic() public onlyOwner
    {
        publicMintPossible = true;
    }

    //set base uri for metadata
    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    //pause the mint
    function pause(bool _state) public onlyOwner {
        paused = _state;
    }

    //remove user from whitelist
    function removeWhitelistUser(address _user) public onlyOwner {
        whitelisted[_user] = false;
    }


    //TODO:
    function mintLegendary() public onlyOwner
    {
        for (uint256 i = 9886; i < maxSupply; i++)
        {_safeMint(msg.sender, i);}


    }

    function mintForGiveaways(uint256 amount) public onlyOwner {
        for (uint256 i = 0; i < amount; i++) {
            _safeMint(msg.sender, nftCounter);
            nftCounter = nftCounter + 1;}

    }

    //function for pausing the whitelist sales
    function checkForPause() public
    {
        if ((nftCounter == wlPlaces[0]) || (nftCounter == wlPlaces[1]))
        {
            pause(true);
        }
    }

    //TODO: in general only 2
    //mint nfts
    function mint(uint256 _mintAmount) isWhitelisted(msg.sender) public virtual payable {
        require(!paused, "Mint paused!");
        require(_mintAmount > 0, "You can't mint zero!");
        require(minted[msg.sender] + _mintAmount <= maxMintAmount, "You can only mint two!");
        require(nftCounter + _mintAmount <= 9886, "Sold out!");
        //TODO: check
        if (msg.sender != owner()) {
            if ((nftCounter + _mintAmount) <= wlPlaces[0]) {
                require((nftCounter + _mintAmount) <= wlPlaces[0], "Not enough NFT left for sale!");
                require(msg.value >= costsWL[0] * _mintAmount, "Not enough ETH!");}
            else if ((wlPlaces[0] < (nftCounter + _mintAmount)) && ((nftCounter + _mintAmount) <= wlPlaces[1])) {
                require((nftCounter + _mintAmount) <= wlPlaces[1], "Not enough NFT left for sale!");
                require(msg.value >= costsWL[1] * _mintAmount, "Not enough ETH!");}
            else if ((wlPlaces[1] < (nftCounter + _mintAmount)) && ((nftCounter + _mintAmount) <= wlPlaces[2]))
            {
                require((nftCounter + _mintAmount) <= wlPlaces[2], "Not enough NFT left for sale!");
                require(msg.value >= costsWL[2] * _mintAmount, "Not enough ETH!");
            }
        }
        for (uint256 i = 0;
            i < _mintAmount;
            i++) {
            _safeMint(msg.sender, nftCounter);
            nftCounter = nftCounter + 1;
            minted[msg.sender] += 1;
            checkForPause();
        }
    }

    function publicMint(uint256 _mintAmount) public virtual payable {
        require(publicMintPossible == true, "No public mint possible!");
        require(!paused, "Mint paused!");
        require(_mintAmount > 0, "You can't mint zero!");
        require(minted[msg.sender] + _mintAmount <= maxMintAmount, "You can only mint two!");
        require(nftCounter + _mintAmount <= maxSupply, "Sold out!");
        require(msg.value >= publicMintPrice * _mintAmount, "Not enough ETH!");
        for (uint256 i = 0;
            i < _mintAmount;
            i++) {
            _safeMint(msg.sender, nftCounter);
            nftCounter = nftCounter + 1;
            minted[msg.sender] += 1;
        }
    }

    //metadata URI for nfts
    function tokenURI(uint256 tokenId)
    public
    view
    virtual
    override
    returns (string memory)
    {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );

        if (revealed == false) {
            return string(abi.encodePacked(notRevealedUri));
        }

        string memory currentBaseURI = _baseURI();
        return string(abi.encodePacked(
                currentBaseURI, "/",
                Strings.toString(tokenId)
            ));
    }

    //return nft ids of one owner
    //TODO use balanceOf
    function walletOfOwner(address _owner)
    public
    view
    returns (uint256[] memory)
    {
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokenIds;
    }

    //set url for not revealed metadata
    function setNotRevealedURI(string memory _notRevealedURI) public onlyOwner {
        notRevealedUri = _notRevealedURI;
    }

    // set contract url
    function setContractURI(string memory _contractURI) public onlyOwner {
        contractUri = _contractURI;
    }

    //withdraw the collected eth from mint
    function withdraw() payable onlyOwner public {
        payable(msg.sender).transfer(address(this).balance);
    }
}
